(pageData: CrudPage): WebPage<CrudPage>[] => {
  const dataPage = {
    pageData,
    queryPath: `data/${pageData.modelName}`,
    isMenuHidden: false,
    menuTitle: humanCase(pageData.modelName),
  };
  const upsertOrNot =
    pageData.canCreate || pageData.canUpdate
      ? {
          pageData,
          queryPath: `upsert/${pageData.modelName}`,
          isMenuHidden: true,
        }
      : undefined;

  return [dataPage, upsertOrNot].filter(notEmpty);
}
